import React from "react";
import AddIcon from '@material-ui/icons/Add';

const Form = () =>{
    return (
        <>
        <div className="form_box">
            <form className="form">
                <input type="text" placeholder="Title"/>
                <br/>
                <textarea type="text" cols="" placeholder="Enter Your Content" ></textarea>
            </form>
            <button className="add_btn"><AddIcon/></button>
        </div>
        </>
    )
}

export default Form;
